12 full-page miniatures, most of them matched with a facing page large decorated initial that opens the relevant section.
                                        : The manuscript opens with an inserted bifolium with a portrait of a female owner facing St Mary of Egypt. The male owner appears five times (listed below), often accompanied by John the Baptist. Both these saints are significant for pilgrimages and the Holy Land. The male owner is potrayed as watching the facing illustaration, e.g. , or watching from the margin, e.g. .  , an inserted leaf, has a full-page illustration on both recto and verso. 
                                        The miniatures are composed as a frame in frame, with an outer decorative border and an inner frame usually shaped as a window or portal. 6 of the borders feature realistically painted flowers and different animals placed on a yellow background, e.g. . 5 borders, all featuring the male owner, make use of architectural motifs, e.g. . The border on  functions as an extension of the main image. 
                                        The motifs consist of key scenes associated with the relevant chapter with characters realistically portrayed in contemporary clothing and backgrounds often featuring castles or other buildings. The motifs are:
                                        : Mary of Egypt surrounded by five red angels. 
                                        : owner portrait, praying woman, bust in half-profile.  
                                        : Annunciation (Hours of the Virgin);
                                        : Crucifixion (Seven penitential psalms);
                                        : owner portrait and John the Baptist (Seven penitential psalms);
                                        : Last Judgement (Seven penitential psalms); 
                                        : Raising of Lazarus (Office for the dead); 
                                        : Resurrection; owner portrait with family (Prayers for visiting holy places in Jerusalem);
                                        : Nativity (Prayers for visiting holy places in Betlehem);
                                        :  the Betrayal, owner portrait and John the Baptist (Hours of the Holy Cross);
                                        : Pietà; owner portrait and John the Baptist (Hours of the Holy Cross);
                                        : Pentecost; owner portrait (Hours of the Holy Spirit).
                                        In addition, there are two half-page grisailles. : different scenes from the life of Christ; : prefigurations.

: decorated initials over 5 lines with a vegetative/leaf-like shape with yellow-brown colour tones. They are placed on a background of alternating red or and blue. The initials and the following text are surrounded by frames that usually match that of the facing page illustration. 
: the manuscript also contains 7 historiated intials over 6 lines. The letter shapes are similar to the initials above. These intials are found in Hours of the virgin and open the different hours. The motifs are:
: Visitation;
: Nativity;
: Annunciation to the Shepherds;
: Adoration of the Magi;
: Presentation in the Temple;
: Flight into Egypt;
: Slaughter of the Innocents.
: paragraphs introduced by dentelle initials over 2 lines in gold paint on a square background of blue or red. Same style inital over 1 line also used for sentences. The intials sometimes have painted highlights or flourishing.
